script: |
  super -f text -I q1801.spq | sort > q1801.out

inputs:
  - name: q1801.spq
    data: |
      SELECT DISTINCT col0 + col0 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT + + col2 * 57 / - - col0 BETWEEN - CAST ( NULL AS INTEGER ) * col2 AND - col1 * col2;
  - name: tab2

outputs:
  - name: q1801.out
    data: |
      128
      150
      92
